textOriginal:
O assalariado antidireitos-trabalhistas;
O Pobre antissus;
A Classes D/E que se acha Classe A;
Descapitalizado que defende o capitalismo;
Oprimido defendendo o opressor;
A Minoria que defende a maioria;
Nazista do agreste tupiniquim;
Vacinado anti-vacina;

Se tá gostoso? Então tá, né!
